import React from "react";

function Experience() {
    return (
        <section id="Experience">
            <h1 className="font-bold text-lg sm:text-2xl">Work Experience</h1>
            <div className="flex">
                <ul>
                    <li>Product Marketing Engineer</li>
                    <li><input type="button" name="job" id="IEEE"></input> Director of Technology</li>
                    <li>Independent Developer</li>
                </ul>

            </div>
        </section>
    )
}

export default Experience
